// Node: Collect All Products (FIXED)
const allItems = $input.all();
const shopifyCollectionsMap = new Map();
const productsToProcess = [];

console.log(`Collect All Products - Received ${allItems.length} items.`);

// --- First Pass: Map all Shopify collections by their title ---
allItems.forEach((item) => {
  // Identify collection items (they have a collection_id but no product id)
  if (item.json.collection_id && !item.json.id) {
    const collectionTitle = item.json.title;
    if (collectionTitle && !shopifyCollectionsMap.has(collectionTitle)) {
      shopifyCollectionsMap.set(collectionTitle, {
        collection_id: item.json.collection_id,
        collection_handle: item.json.handle,
      });
      console.log(`Mapped Shopify Collection: \"${collectionTitle}\" -> ID: ${item.json.collection_id}`);
    }
  }
});

// --- Pre-computation: Find the pet name for this batch ---
const referenceItem = allItems.find(item => item.json.petname);
const petnameForBatch = referenceItem ? referenceItem.json.petname : null;

if (!petnameForBatch) {
  console.error("CRITICAL: Could not determine pet name for this batch. Processing will likely fail.");
  return [];
}

// --- Second Pass: Match products to their collections ---
allItems.forEach((item) => {
  // Identify product items (they have a product ID, tags, and a title)
  if (item.json.id && item.json.tags && item.json.title && item.json.title.includes(' - ')) {
    const productTitle = item.json.title;

    // 1. Extract the theme name from the product title.
    const productTheme = productTitle.split(' - ')[0].trim();

    // 2. Construct the expected Shopify collection title.
    const collectionTitleKey = `${petnameForBatch} ${productTheme}`;

    // 3. Look up the collection in our map.
    const collectionData = shopifyCollectionsMap.get(collectionTitleKey);

    if (collectionData) {
      const sessionIdTag = item.json.tags && item.json.tags.length > 3 ? item.json.tags[3] : null;
      if (!sessionIdTag) {
        console.warn(`Could not find a session_id tag for product: \"${productTitle}\". Skipping.`);
        return; // Skips this product
      }

      // ##### CHANGE 1: PUSH A PLAIN JAVASCRIPT OBJECT, NOT AN N8N ITEM STRUCTURE #####
      productsToProcess.push({
        product_title_to_search_in_shopify: productTitle,
        shopify_collection_id: collectionData.collection_id,
        shopify_collection_handle: collectionData.collection_handle,
        shopify_collection_original_title: collectionTitleKey,
        session_id_to_match: sessionIdTag,
        gelato_product_id: item.json.id
      });
      console.log(`SUCCESS: Matched product \"${productTitle}\" to collection \"${collectionTitleKey}\"`);
    } else {
      console.warn(`FAIL: No Shopify collection found for product: \"${productTitle}\". (Used key: \"${collectionTitleKey}\"). This product will be skipped.`);
    }
  }
});

console.log(`Total products to process: ${productsToProcess.length}`);

// Return each product object as a separate n8n item
return productsToProcess.map(product => ({ json: product }));

const currentProductData = $input.item.json;
return {
  json: {
    product_title: currentProductData.product_title_to_search_in_shopify,
    shopify_collection_id: currentProductData.shopify_collection_id,

    // --- ADD THIS LINE ---
    session_id_to_match: currentProductData.session_id_to_match, // Pass it through

    // Context fields (no changes needed here)
    original_search_title: currentProductData.product_title_to_search_in_shopify,
    original_shopify_collection_title: currentProductData.shopify_collection_original_title,
    gelato_product_id_context: currentProductData.gelato_product_id,
    handle :currentProductData.shopify_collection_handle
  }
};

// Get the API response from SearchShopifyProduct
const shopifyApiResponse = $input.item.json;

// Get the data sent *into* SearchShopifyProduct
const dataFromPreviousNode = $('Format Product Search Data').item.json;

let foundProduct = null;
const allFoundProducts = (shopifyApiResponse.data?.products?.edges || []).map(edge => edge.node);
const targetSessionId = dataFromPreviousNode.session_id_to_match;
const searchedTitle = dataFromPreviousNode.product_title;

console.log(`--- Starting Product ID Extraction ---`);
console.log(`Target Session ID: "${targetSessionId}"`);
console.log(`Searching for product title: "${searchedTitle}"`);

if (!targetSessionId) {
  console.error("CRITICAL ERROR: No session_id was passed to this node. Cannot perform matching. Check the 'Collect All Products' node.");
  return { json: { product_id: null, error: "Missing session_id_to_match" } };
}

if (allFoundProducts.length === 0) {
  console.warn(`Shopify search returned ZERO products for title "${searchedTitle}".`);
} else {
  console.log(`Shopify search returned ${allFoundProducts.length} product(s). Now filtering...`);

  const lowerCaseTargetSessionId = targetSessionId.toLowerCase();

  for (const product of allFoundProducts) {
    const shopifyTagsArray = product.tags || [];
    const lowerCaseTags = shopifyTagsArray.map(tag => tag.toLowerCase());

    console.log(`- Checking Product legacyResourceId: ${product.legacyResourceId}. Tags: [${lowerCaseTags.join(", ")}]. Does it include "${lowerCaseTargetSessionId}"?`);

    if (lowerCaseTags.includes(lowerCaseTargetSessionId)) {
      foundProduct = product;
      console.log(`✅ MATCH FOUND! Using legacyResourceId: ${foundProduct.legacyResourceId}`);
      break;
    }
  }
}

if (foundProduct) {
  return {
    json: {
      product_id: foundProduct.legacyResourceId, // ✅ use legacyResourceId
      collection_id: dataFromPreviousNode.shopify_collection_id,
      context_searched_title: searchedTitle,
      context_original_shopify_collection_title: dataFromPreviousNode.original_shopify_collection_title,
      context_gelato_product_id: dataFromPreviousNode.gelato_product_id_context
    }
  };
} else {
  console.error(`❌ FAILED: After checking all ${allFoundProducts.length} products, none had the tag "${targetSessionId}".`);
  return {
    json: {
      product_id: null,
      collection_id: dataFromPreviousNode.shopify_collection_id,
      error: `Product with matching session_id tag '${targetSessionId}' not found.`
    }
  };
}

const shopifyCollectApiResponse = $input.first().json;
const contextData = $('Extract Shopify Product ID').item.json; // Data from Code3

if (shopifyCollectApiResponse.collect && shopifyCollectApiResponse.collect.id) {
  console.log(`✅ SUCCESS: Shopify Product (Shopify ID: ${shopifyCollectApiResponse.collect.product_id}, originally searched as "${contextData.context_searched_title}") added to Shopify Collection (Shopify ID: ${shopifyCollectApiResponse.collect.collection_id}, title: "${contextData.context_original_shopify_collection_title}"). Gelato Product ID was: ${contextData.context_gelato_product_id}.`);
} else {
  console.error(`❌ FAILED or SKIPPED: Could not add product to collection...`);
}
return [$input.first()]; // Passes the Shopify API response along

